import Logo from '../images/logo.svg';
import Todo from '../images/icon-todo.svg';
import Calendar from '../images/icon-calendar.svg';
import Reminders from '../images/icon-reminders.svg';
import Planning from '../images/icon-planning.svg';
import classes from "./header.module.css";
function Header(){
    var link = "#";
    var emptyString = "";
    return (
    <header>
        <div><img src={Logo} alt="Snap" /></div>
        <div>
            <nav>
            <ol>
                <li className={classes.Drop}>Features
                <div className={classes.DropDown}>
                        <span><img src={Todo} alt={emptyString} /><a href={link}>Todo List</a></span>
                        <span><img src={Calendar} alt={emptyString} /><a href={link}>Calendar</a></span>
                        <span><img src={Reminders} alt={emptyString} /><a href={link}>Reminders</a></span>
                        <span><img src={Planning} alt={emptyString}/><a href={link}>Planning</a></span>
                </div>
                </li>
                <li className={classes.Drop}>Company
                    <div className={classes.DropDown}>
                        <span><a href={link}>History</a></span>
                        <span><a href={link}>Our Team</a></span>
                        <span><a href={link}>Blog</a></span>
                    </div>
                </li>
                <li><a href={link}>Careers</a></li>
                <li><a href={link}>About</a></li>
            </ol>
            </nav>
            <div>
            <span><button>Login</button></span>
            <span><button>Register</button></span>
            </div>
        </div>
        
    </header>
    );
}
export default Header;
